import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

let curdate= new Date();
curdate=curdate.getHours();
let greetings="";


function cssstyle() {
    const cssStyle1= "https://picsum.photos/seed/picsum/200/300";
const cssStyle2="https://picsum.photos/id/1003/1181/1772";
const  cssStyle3="https://picsum.photos/id/1004/5616/3744";
    return cssstyle
};

if(curdate>=1 && curdate<12)
{
    greetings="Good Morning.";
    <div className="img_div"> 
   <img src={cssStyle1}  alt="random images"/>;
   </div>

}
else if(curdate>12 && curdate<=19)
{
    greetings="Good Afternoon.";
    <div className="img_div"> 
    <img src={cssStyle2}  alt="random images"/>;
    </div>
}
else
{
    greetings="Good Night.";
    <div className="img_div"> 
    <img src={cssStyle3}  alt="random images"/>;
    </div>
}

ReactDOM.render
(
    <>
    <h1> Hello Sir, {greetings}</h1>
    </>,
    document.getElementById("root")
);
